export default {
	myVar1: [],
	myVar2: {},
	combineTwoLists: () => {
		let ret = []
		if(SelectCurrentWarehousePerson.selectedOptionValues != null){
			for(let i = 0; i < SelectCurrentWarehousePerson.selectedOptionValues.length; i++){
				let line = {
					"person":{"id": SelectCurrentWarehousePerson.selectedOptionValues[i]}
				}
				ret.push(line)
			}
		}
		if(SelectOtherWarehousePerson.selectedOptionValues != null){
			for(let i = 0; i < SelectOtherWarehousePerson.selectedOptionValues.length; i++){
				let line = {
					"person":{"id": SelectOtherWarehousePerson.selectedOptionValues[i]}
				}
				ret.push(line)
			}
		}
		return ret
	},
}
